import React from "react";
import Nav from "react-bootstrap/Nav";

export default function BookResults(props) {
  return (
    <Nav className="justify-content-center" activeKey="/home">
      <Nav.Item>
        <Nav.Link href="/">New Search</Nav.Link>
      </Nav.Item>
    </Nav>
  );
}
